        <p>
           Bryan Rohena Rosa, mundialmente conocido como Bryant Mayers es un cantante y compositor puertorriqueño de música urbana.  Nació el 5 de abril de 1998 en Loma Alta,se hizo mundialmente famoso gracias a la canción de Esclava,
           la cual revoluciono completamente el género. Tras esto siguió en la escena del trap haciendo colaboraciones con grandes artista como Bad Bunny,Baby Rasta,El Alfa...
           Sus temas destacarón por sus letras violentas y explícitas.
